293035; color: #293035; font-family: Titillium, 'Titillium Web', 'Helvetica Neue', sans-serif; font-size: 16px; font-style: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration: none;">Users are strongly encouraged to contact DEMAX staff prior to preparing and submitting a deuteration/crystallization proposal.<span class="Apple-converted-space">&nbsp;</span><br style="box-sizing: border-box;" />General enquiries can be sent to:<span class="Apple-converted-space">&nbsp;</span><a style="box-sizing: border-box; color: #007bff; text-decoration: none; background-color: transparent; text-decoration-skip: objects;" href="mailto:demax@esss.se">demax@esss.se</a><span class="Apple-converted-space">&nbsp;</span>or to one of the<a style="box-sizing: border-box; color: #007bff; text-decoration: none; background-color: transparent; text-decoration-skip: objects;" href="https://demax.esss.dk/contact"><span class="Apple-converted-space">&nbsp;</span>subject matter experts.</a></p>\n<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; caret-color: #293035; color: #293035; font-family: Titillium, 'Titillium Web', 'Helvetica Neue', sans-serif; font-size: 16px; font-style: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration: none;">\n<li style="box-sizing: border-box;">Proposals should be written in English, properly referenced, and prepared in the<span class="Apple-converted-space">&nbsp;</span><a style="box-sizing: border-box; color: #007bff; text-decoration: none; background-color: transparent; text-decoration-skip: objects;" href="https://demaxapi.esss.dk/api/word/attachment">Word template</a>. Please keep to the 2 page limit, including Summary, Background (Science Case, Practical Consideration, References, Figures/Tables).<span class="Apple-converted-space">&nbsp;</span></li>\n<li style="box-sizing: border-box;">Access to DEMAX is granted on the basis of both a technical and a peer-review process.</li>\n<li style="box-sizing: border-box;">Proposals awarded during initial operations (2019-2022) will be free of charge. During formal user operations (beyond 2030) we reserve the right to ask for partial financial contributions towards consumables &amp; shipping costs.<span class="Apple-converted-space">&nbsp;</span></li>\n<li style="box-sizing: border-box;">During initial operations, we will not limit access to DEMAX based on ESS-membership. Beyond this period, we will respect the user access policy that will be applicable ESS-wide.<span class="Apple-converted-space">&nbsp;</span></li>\n<li style="box-sizing: border-box;">Biological and chemical deuteration proposals are run as a service but users for protein crystallization are welcome to come in person as well.<span class="Apple-converted-space">&nbsp;</span></li>\n<li class="str" style="box-sizing: border-box;"><em style="box-sizing: border-box;">Users should note that the contributions by DEMAX should be acknowledged in any publications containing materials obtained from us. For particularly challenging projects that require above average involvement from DEMAX, relevant DEMAX staff should be acknowledged through co-authorship of any subsequent publications.</em></li>\n</ul>
